    <div>
        <MediaQuery maxWidth={1224}>
          {/* <MobileFixedMenu menu={menu} config={config} /> */}
          <AppBar color="paper" positionsticky="true">
              <Toolbar></Toolbar>
          </AppBar>
        </MediaQuery>

        <MediaQuery minWidth={1224}>
          {/* <FixedMenu menu={menu} config={config} /> */}
          <AppBar color="default" positionsticky="true">
            <Toolbar></Toolbar>
          </AppBar>
        </MediaQuery>
    </div>
    )
}
